import React from "react";
import Footer from "../../../Components/footer/Footer";
import {
  Box,
  Flex,
  Avatar,
  Link,
  Button,
  Menu,
  MenuButton,
  MenuList,
  MenuItem,
  MenuDivider,
  useDisclosure,
  useColorModeValue,
  Stack,
  Heading,
  useColorMode,
  Center,
  List,
  Card,
  CardBody,
  Icon,
  ListItem,
  Text,
  Divider,
  Grid,
} from "@chakra-ui/react";
import { MoonIcon, SunIcon } from "@chakra-ui/icons";

const AdminMainContent = () => {
  const blocks = [1, 2, 3, 4, 5, 6, 7, 8, 9];

  return (
    <Box p="2em">
      <Box>
        <Heading mb="2em">Advertisements</Heading>
        <Grid templateColumns="repeat(3, 1fr)" gap={4}>
          {blocks.map((block) => (
            <Box
              key={block}
              bg="blue.500"
              width="100%"
              height="100px"
              borderRadius="md"
            />
          ))}
        </Grid>
      </Box>
      <Footer />
    </Box>
  );
};

export default AdminMainContent;
